    <h1>Human</h1>
    <br>
    <p>Human was first recorded in the mid 13th century,<br> and owes its existence to the Middle French humain <br>“of or belonging to man.” That word, in turn,<br> comes from the Latin humanus, thought to be a hybrid <br>relative of homo, meaning “man,” and humus, meaning “earth.”</p>
